  "disputes.management.common.defenseReasons.firstChargebackDoesNotMeetPrerequisites": "The first chargeback does not meet the prerequisites for the dispute reason code. For example, an issuer processes a chargeback for message reason code 4837 (No Cardholder Authorization), with a cardholder letter alleging nonreceipt of merchandise. Since message reason code 4837 does not address issues related to nonreceipt of merchandise, the issuer's first chargeback was invalid, since it does not meet the prerequisites of message reason code 4837, which require the chargeback to include a cardholder letter stating that the transaction was not authorized.",
  "disputes.management.common.defenseReasons.firstChargebackInvalid": "Information provided by the issuer that is relevant is illegible to the point where it cannot be established that the first chargeback is valid. One must make every attempt to qualify the documentation before using this defense reason.",
  "disputes.management.common.defenseReasons.formatCbmmddyyArdXxxExpected": "The issuer did not provide the information required properly. Expected was the DE72 message text to be in the format CBMMDDYY ARD XXXXXXXXXXXXXXXXXXXXXXX, where MMDDYY denotes the date and XXXXXXXXXXXXXXXXXXXXXXX the Acquirer Reference Data of the chargeback containing the documentation to support this chargeback.",
  "disputes.management.common.defenseReasons.formatMultipleTransactionsNnnExpected": "The issuer did not provide the information required properly. Expected was the DE72 message text to be in the format MULTIPLE TRANSACTIONS NNN, where NNN denotes the number of chargebacks to which the supplied documentation applies to.",
  "disputes.management.common.defenseReasons.formatRpcsMmddyyExpected": "The issuer did not provide the information required properly. Expected was the DE72 message text to be in the format RPCS MMDDYY, where MMDDYY denotes date the account number was listed in the Recurring Payment Cancellation Service (RPCS).",
